import './App.css';


const App = () => {
  const users = [
    {name:"Pedro",age: 21},
    {name:"Jack",age: 25},
    {name:"Jessica",age: 45}
  ]
  return (users.map((user,key)=>{
    return (<h1 key={key} style={{color:"green"}}>{user.name}</h1>
            )
  }))

};


export default App
